import App from './App';
import { BrowserRouter} from 'react-router-dom';
const root = ReactDOM.createRoot(document.getElementById('root'));
let renderEntireTree = (state) =>{
	console.log(state)
	root.render(
		<React.StrictMode>
			<BrowserRouter>
			<App state={store.getState()} dispatch={store.dispatch.bind(store)}/>
			</BrowserRouter>
